DROP TABLE IF EXISTS `cinema`;
CREATE TABLE `cinema` (
  `cinema_id` varchar(255) CHARACTER SET utf8 NOT NULL,
  `cinema_name` varchar(255) CHARACTER SET utf8 DEFAULT NULL COMMENT '电影院名',
  `cinema_address` varchar(255) CHARACTER SET utf8 DEFAULT NULL COMMENT '电影院地址',
  `cinema_income` int(255) DEFAULT NULL,
  `longitude` double(255,5) NOT NULL COMMENT '经度',
  `latitude` double(255,5) NOT NULL COMMENT '纬度',
  PRIMARY KEY (`cinema_id`),
  UNIQUE KEY `cinema_id` (`cinema_id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

