DROP TABLE IF EXISTS `film`;
CREATE TABLE `film` (
  `film_id` varchar(255) NOT NULL COMMENT '电影id',
  `film_name` varchar(255) NOT NULL COMMENT '电影名',
  `film_score` float(255,1) DEFAULT NULL COMMENT '电影评分',
  `film_rank` int(255) DEFAULT NULL COMMENT '电影排名',
  `film_style` varchar(255) DEFAULT NULL COMMENT '电影类型',
  `director` varchar(255) DEFAULT NULL COMMENT '导演',
  `actor` varchar(255) DEFAULT NULL COMMENT '主演',
  `film_introduction` varchar(255) DEFAULT NULL COMMENT '简介',
  `film_picture_url` mediumtext COMMENT '图片地址',
  PRIMARY KEY (`film_id`),
  UNIQUE KEY `film_id` (`film_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of film
-- ----------------------------
INSERT INTO `film` VALUES ('12875', '阳光姐妹淘', '0.0', '5', '喜剧/剧情', '包贝尔', '殷桃/倪虹洁/夏梦', '当年陪你走过青春的好朋友，后来还有联系吗？大家又各自过得好吗？家庭主妇张丽君在医院重逢了病重的高中好姐妹林青，林青希望离世前能跟当年的姐妹们重聚。于是，张丽君开启了寻找姐妹的旅程，这一路，大家找回了青春，也重新审视了当下生活。时间好快，人已长大，好想和你再相聚。', '');
INSERT INTO `film` VALUES ('57919', '哆啦A梦：伴我同行2', '8.8', '2', '动画/日本', '山崎贵', '八木龙一', '《哆啦A梦：伴我同行2》是纪念《哆啦A梦》50周年的作品之一，由八木龙一、山崎贵联合指导的动画电影，水田山葵、大原惠美、嘉数由美、木村昴等人参与配音。于2020年11月20日在日本上映 [1]  ，2021年5月28日在中国内地上映 [8]  。\n该片取材自藤子·F·不二雄创作的漫画《哆啦A梦》中的短篇故事《怀念奶奶》，讲述了想念奶奶的大雄乘坐时光机返回过去与奶奶相见，因为奶奶想看到自己的新娘，便跑去找静香求婚所引发的一系列故事。', '');
INSERT INTO `film` VALUES ('80975', '天堂电影院', '9.1', '9', '剧情/爱情/意大利,法国', '朱塞佩·托纳多雷', '菲利浦·诺瓦雷', '在意大利南部小镇姜卡尔多，童年的小多多不仅喜欢看电影，还喜欢看放映师艾弗达“剪”电影：在40年代的意大利小镇上，电影在放映之前都要经由牧师检查，把认为观众不宜的镜头（比如接吻戏）严格地剪掉之后，才可以放映。所以，观众每当发现接吻镜头又被删去了的时候，就会全场起哄、甚至吐口水；而放到煽情的段落，观众们又会集体嚎啕大哭，总之电影院里总是热闹非凡。\n', '');
INSERT INTO `film` VALUES ('94036', '速度与激情9', '7.5', '1', '动作/冒险/美国', '林诣彬', '范·迪赛尔', '范迪塞尔饰演的唐老大多姆托莱多，与莱蒂和他的儿子小布莱恩，过上了远离纷扰的平静生活。然而他们也知道，安宁之下总潜藏着危机。这一次，为了保护他所爱的人，唐老大不得不直面过去。他和伙伴们面临的是一场足以引起世界动荡的阴谋，以及一个前所未遇的一流杀手和高能车手。而这个名叫雅各布（约翰塞纳饰）的人，恰巧是多姆遗落在外的亲弟弟。', '');

